ter\",\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"left\":\"var:preset|spacing|60\"}}}} -->\n<div class=\"wp-block-columns alignwide are-vertically-aligned-center\"><!-- wp:column {\"width\":\"50%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:50%\"><!-- wp:heading {\"textAlign\":\"left\",\"fontSize\":\"x-large\"} -->\n<h2 class=\"wp-block-heading has-text-align-left has-x-large-font-size\">Embrace<br>sustainable fashion</h2>\n<!-- /wp:heading -->\n\n<!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"left\"}} -->\n<div class=\"wp-block-buttons\"><!-- wp:button --><div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">Discover more</a></div><!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"50%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:50%\"><!-- wp:paragraph {\"style\":{\"layout\":{\"selfStretch\":\"fixed\",\"flexSize\":\"70%\"}}} -->\n<p>We believe that fashion should be as kind to the planet as it is to your wardrobe. With a commitment to sustainability and environmental responsibility, we curate a collection of chic and eco-friendly clothing.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"layout\":{\"selfStretch\":\"fixed\",\"flexSize\":\"70%\"}}} -->\n<p>From organic fabrics to recycled materials, every piece in our collection is thoughtfully crafted with the planet in mind.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"var:preset|spacing|30\"} -->\n<div style=\"height:var(--wp--preset--spacing--30)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:image {\"id\":75,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"wide\"} -->\n<figure class=\"wp-block-image alignwide size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/06/man-person-winter-photography-st